           function generateTableHead(table, data, header_names, tooltip_strings) {

            row.appendChild(th);

            } else if (key == 'pre_weights_range' && data[key] != null) {

          'pre_type': 'Original Type',

          'pre_weights_range': 'Original Weights Range',
          'post_weights_range_dequant': 'Compressed Weights Range',
          'quantization_error': 'Quantization Error',
          'quantization_error_percentile': 'Quantization Error Percentile',
          'pre_num_elements': 'Number of Elements'
        };
        let tooltip_strings = {
          'order': 'The order of the tensor in the execution graph. Higher numbers indicate later on in the graph',
          'name':'The internal name of the layer/tensor',
          'is_quantized': 'True if quantization of any kind was applied to this tensor, false if it was copied to the output unchanged',
          'used_tensor_splitting': 'True if this tensor was created as the result of applying tensor splitting, of if tensor splitting created a new tensor from this one',
          'compression_ratio': 'The compressed tensor size divided by the original size (in bytes)',
          'orig_shape': 'The shape of the tensor: an array of integers describing the size of each dimension',
          'post_bits': 'How many bits were used for quantization',
          'pre_total_size_bytes': 'The size in bytes of the original tensor\'s storage space',
          'post_total_size_bytes': 'The size in bytes of the compressed tensor\'s storage space',
          'pre_type': 'The datatype of the tensor before compression',
          'post_type': 'The datatype of the tensor after compression',
          'pre_weights_range': 'The minimum and maximum weight value found in the original tensor',
          'post_weights_range_dequant': 'The minimum and maximum weight value found in the compressed tensor, after dequantizing back to original shift and scale.',
          'quantization_error': 'A measurement of how much the tensor weights have changed (degraded) before and after compression',
          'quantization_error_percentile': 'A relative measure of how this tensor\'s quantization error compares to other tensors in the graph. 0 = Best quantization error, 1 = Worst quantization error.',
          'pre_num_elements': 'The number of individual scalar values found in the tensor, found by multiplying the numbers in the shape together'
        };
        generateTableHead(table, table_headers, header_names, tooltip_strings);
        let tbody = table.createTBody();

        for (var layer of visualization_data.report_rows) {

            //create div container for  element for this layer histogram
            var container_el = document.createElement('div');
            container_el_id = 'container-' + layer.name;
            container_el.setAttribute("id",  container_el_id );
            document.getElementById('body').appendChild(container_el);

            //create canvas element for this layer pre-quant histogram
            var canvas_prechart_el = document.createElement('canvas');
            canvas_prechart_el_id = 'prechart-' + layer.name;
            canvas_prechart_el.setAttribute("id",  canvas_prechart_el_id );

            //create canvas element for this layer post-quant histogram

            var canvas_postchart_el = document.createElement('canvas');
            canvas_postchart_el_id = 'postchart-' + layer.name;
            canvas_postchart_el.setAttribute("id",  canvas_postchart_el_id );

            // create loading gif
            var loading_img = document.createElement('img');
            loading_img.src = "https://thumbs.gfycat.com/RapidRadiantBug-small.gif";
            loading_img.style.width = "50px";
            loading_img.style.height = "37.5px";
            loading_img.id = "loading-" + layer.name;
            // generate table rows

            var generateTable = function(table, data) {
                let row = tbody.insertRow();
                // insert charts into first column
                let cell = row.insertCell();
                $(cell).addClass('histograms-cell');
                $(cell).click(function(){
                    showDetailPopup(data);
                });
                cell.appendChild(canvas_prechart_el);
                cell.appendChild(canvas_postchart_el);
                cell.appendChild(loading_img);
                //for (key in data) {
                for (key of table_headers) {

                    let cell = row.insertCell();
                    var text = formatDataValue(data, key);

                    cell.appendChild(document.createTextNode(text));


                }
            }

            generateTable(table, layer);
        }

        window.currentDetailPopup = null;
        function showDetailPopup(data){
            if(window.currentDetailPopup){
                window.currentDetailPopup.dialog("destroy");
                window.currentDetailPopup.detach();
                window.currentDetailPopup = null;
            }
            window.currentDetailPopup = $( "<div></div>" );

            //create canvas element for this layer pre-quant histogram
            var canvas_prechart_el = document.createElement('canvas');
            canvas_prechart_el_id = 'prechart-popup-' + data.name;
            canvas_prechart_el.setAttribute("id",  canvas_prechart_el_id );
            $(canvas_prechart_el).addClass('popup_chart');

            //create canvas element for this layer post-quant histogram

            var canvas_postchart_el = document.createElement('canvas');
            canvas_postchart_el_id = 'postchart-popup-' + data.name;
            canvas_postchart_el.setAttribute("id",  canvas_postchart_el_id );
            $(canvas_postchart_el).addClass('popup_chart');

            makeCharts(canvas_prechart_el, canvas_postchart_el, data);

            window.currentDetailPopup.append(canvas_prechart_el);
            window.currentDetailPopup.append(canvas_postchart_el);

            let table = $('<table></table>')[0];
            let tbody = table.createTBody();
            for (key of popup_keys) {
                let row = tbody.insertRow();
                let cell1 = row.insertCell();
                cell1.appendChild(document.createTextNode(header_names[key]));
                $(cell1).attr('title', tooltip_strings[key]);
                let cell2 = row.insertCell();
                var text = formatDataValue(data, key);
                cell2.appendChild(document.createTextNode(text));

            }
            window.currentDetailPopup.append(table);

            window.currentDetailPopup.dialog({
                width:'auto',
                title: data['name']
            });
        }

        var datatable = $('#main-table').DataTable({
            "paging":   false,
            "ordering": true,
            "info":     true,
            "language" : { search: "" },
            //"fixedHeader": true,
            "scrollY": "calc(95vh - 200px)",
            "scrollX": "100%",
            "scrollCollapse": true,
            "columnDefs": [
              { "orderable": false, "targets": 0 },
              { className: "dt-left",  targets: [0, 2]},
              { className: "dt-right",  targets: [1,3,4,5,6]}

            ],
            "columns": [
              null,
              { "type": "num" },
              null,
              null,
              null,
              null,
              null
            ]
        });

        datatable
            .column( '5:visible' )
            .order( 'desc' )
            .draw();
        setTimeout(function () {
             // this seems to fix header widths for some reason
             $($.fn.dataTable.tables( true ) ).DataTable().columns.adjust().draw();
        },200);
        $(".dataTables_filter input").attr("placeholder", "Search by layer name, quantization error...");

      function showResultDetailsPopup(){
            pop = $( "<div></div>" );
            let table = $('<table></table>')[0];
            let tbody = table.createTBody();
            var keys = [];

            for (var k in visualization_data.flat_results) {
              if (visualization_data.flat_results.hasOwnProperty(k)) {
                keys.push(k);
              }
            }

            keys.sort();

            for (key of keys) {
                let row = tbody.insertRow();
                let cell1 = row.insertCell();
                cell1.appendChild(document.createTextNode(key));
                let cell2 = row.insertCell();
                var text = visualization_data.flat_results[key];
                if(key == 'stats_time_end' ||  key  == 'stats_time_start'){
                    try{
                        text = new Date(text * 1000);
                    }catch(e){}
                }
                cell2.appendChild(document.createTextNode(text));

            }
            pop.append(table);
            pop.dialog({
                width:'auto',
                height:'400',
                title: 'Details'
            });
      }

      $( function() {
        $( document ).tooltip();

        // close dialogs on click outside
        $(document).mousedown(function(e) {
            var clicked = $(e.target); // get the element clicked
            if (clicked.is('.ui-dialog-content, .ui-dialog-titlebar, .ui-tooltip') || clicked.parents().is('.ui-dialog-content, .ui-dialog-titlebar, .ui-tooltip')) {
                return; // click happened within the dialog, do nothing here
            } else { // click was outside the dialog, so close it
                $('.ui-dialog-content').dialog("close");
                $('.ui-dialog-content').dialog("destroy");

                $('.ui-dialog-content').detach();
                window.currentDetailPopup=null;

            }
        });

        try{
            $('#sdk-version').text(visualization_data.flat_results.meta_software_version);
        }catch(e){}
        try{
            $('#source-filename').text(visualization_data.flat_results.convert_paths_input || visualization_data.flat_results.command_options_cli_input_path);
        }catch(e){}
        try{
            $('#generated-time').text(new Date(visualization_data.flat_results.stats_time_start * 1000));
        }catch(e){}



      } );

    function sleep(ms) {
        return new Promise(resolve => setTimeout(resolve, ms));
    }

      window.addEventListener('pageshow', async function(event) {

        for (var layer of visualization_data.report_rows) {
            //get canvas element for this layer pre-quant histogram
            var canvas_prechart_el = document.getElementById('prechart-' + layer.name);

            //get canvas element for this layer post-quant histogram
            var canvas_postchart_el = document.getElementById('postchart-' + layer.name);

            makeCharts(canvas_prechart_el, canvas_postchart_el, layer);
            await sleep(20);
        }
    });
        </script>
